import React from 'react'
import {useParams} from 'react-router-dom'

function Card() {
    const cards = [{id:0 , city : "Riyadh" ,country:"Saudi Arabia" , img :`data:image/jpeg;base64,
    `},
{id:1 ,city: "Dubai" , country :"UAE" , img:`data:image/jpeg;base64,

`},
{id:2 , city : "Manama" , country:"AlBahrayn" , img:`data:image/jpeg;base64,
`}]
    
const  id  = useParams().id;
const myItem = cards.find(ele=>Number(id)===ele.id)


   return (
        <div className="card">
            <h1>{myItem.city}</h1>
            <h2>{myItem.country}</h2>
            <img src={myItem.img} alt="img city"/>
            
        </div>
    )
}

export default Card;
